import axios from "axios";
import { GET_DOGS, GET_DETAIL, FILT_BDD, FILT_API, GET_NAME } from "./types";

export const getDogs = (orden) => {
  if (!orden || orden === "normal") {
    return async function (dispatch) {
      const dogsData = await axios.get("http://localhost:3001/dogs");
      const dogs = dogsData.data;

      dispatch({ type: GET_DOGS, payload: dogs });
    };
  }
  if (orden === "inverso") {
    return async function (dispatch) {
      const dogsData = await axios.get("http://localhost:3001/dogs");
      const dogs = dogsData.data;
      const final = dogs.sort((a, b) => b.name.localeCompare(a.name));

      dispatch({ type: GET_DOGS, payload: final });
    };
  }
  if (orden === "liviano") {
    return async function (dispatch) {
      const data = await axios.get("http://localhost:3001/dogs");
      const dogs = data.data;
      dogs.forEach((dog) => {
        if (typeof dogs.id === "number") {
          const final = dogs.sort((a, b) => {
            const aWeight = parseInt(a.weight.metric.split(" - ")[1]);

            const bWeight = parseInt(b.weight.metric.split(" - ")[1]);

            return bWeight - aWeight;
          });
          dispatch({ type: GET_DOGS, payload: final });
        } else {
          const final = dogs.sort((a, b) => {
            const aWeight = parseInt(a.weight.split(" - ")[1]);

            const bWeight = parseInt(b.weight.split(" - ")[1]);

            return bWeight - aWeight;
          });
          dispatch({ type: GET_DOGS, payload: final });
        }
      });
    };
  }
  if (orden === "pesado") {
    return async function (dispatch) {
      const data = await axios.get("http://localhost:3001/dogs");
      const dogs = data.data;
      dogs.forEach((dog) => {
        if (typeof dog.id === "number") {
          const final = dogs.sort((a, b) => {
            const aWeight = parseInt(a.weight.metric.split(" - ")[1]);

            const bWeight = parseInt(b.weight.metric.split(" - ")[1]);

            return aWeight - bWeight;
          });
          dispatch({ type: GET_DOGS, payload: final });
        } else {
          const final = dog.sort((a, b) => {
            const aWeight = parseInt(a.weight.split(" - ")[1]);

            const bWeight = parseInt(b.weight.split(" - ")[1]);

            return aWeight - bWeight;
          });
          dispatch({ type: GET_DOGS, payload: final });
        }
      });
    };
  }
};

//*----------------------------------------------------------------------------

export const getDetail = (id) => {
  return async function (dispatch) {
    const detailData = await axios.get(`http://localhost:3001/dogs/${id}`);
    const detail = detailData.data;
    dispatch({ type: GET_DETAIL, payload: detail });
  };
};

export const getFiltBdd = () => {
  return async function (dispatch) {
    const data = await axios.get("http://localhost:3001/dogs");
    const dogs = data.data;
    const final = await dogs
      .filter((dog) => typeof dog.id === "string")
      .sort((a, b) => a.name.localeCompare(b.name));
    dispatch({ type: FILT_BDD, payload: final });
  };
};

export const getFiltApi = (orden) => {
  if (!orden || orden === "normal") {
    return async function (dispatch) {
      const data = await axios.get("http://localhost:3001/dogs");
      const dogs = data.data;
      const final = await dogs
        .filter((dog) => typeof dog.id === "number")
        .sort((a, b) => a.name.localeCompare(b.name));
